INSERT INTO `zz_test_flow_product` VALUES (1424645807918813184, '单柱校正液压机', '210T', 'YLL30', 89000, '计算机优化直立式C型结构设计，刚性好。机器各部件均安装于机身内，外形整齐美观。液压系统采用手动换向阀，调速方便。具有手动和脚踏两种操作方式。机器行程、压力可在规定范围内调节。', 1424545631073996884, '2021-08-08 16:16:44', 1424545631073996884, '2021-08-08 16:16:44', 1);
